const SAVED_EMAIL = 'SAVED_EMAIL';
const GET_CURRENCIES = 'GET_CURRENCIES';

export const savedEmailAction = (email) => ({
  type: SAVED_EMAIL,
  payload: email,
});

export const getCurrenciesAction = (currencies) => ({
  type: GET_CURRENCIES,
  payload: currencies,
});
